import React from "react";
import Typical from "react-typical";
import express from 'express';
import httpProxy from 'express-http-proxy';
import "./Profile.css";

const app = express();
const port = 3001; // Choose a port for your server

// Serve your React app
app.use(express.static(__dirname));

// Proxy requests to the PDF file
app.use('/pdf', httpProxy('http://localhost:3001'));

app.listen(port, () => {
  console.log(`Server is running on http://localhost:${port}`);
});

const Profile = () => {

  const handleOpenPDF = () => {
    window.open('/pdf/sample.pdf', '_blank');
  };
  
  return (
    <div className="profile-container">
      <div className="profile-parent">
        <div className="profile-details">
          <div className="profile-details-name">
            <span className="primary-text">
              {" "}
              Hello, I'M <span className="highlighted-text">Divya</span>
            </span>
          </div>

          <div className="profile-details-role">
            <span className="primary-text">
              {" "}
              <h1>
                {" "}
                <Typical
                  loop={Infinity}
                  steps={[
                    "Full Stack Developer",
                    2000,
                    "Mern Stack Developer",
                    2000,
                    "React/React Native Developer",
                    2000,
                    "Ethusiastic Developer",
                    2000,
                  ]}
                />
              </h1>
              <span className="profile-role-tagline">
                Knack of building applications with front and back end
                operations.
              </span>
            </span>
          </div>

          <div className="profile-options">
            <a href='Divya-CV.pdf' target="_blank" rel="noopener noreferrer">
              <button className="btn highlighted-btn">Get Resume</button>
            </a>
          </div>
        </div>

        <div className="profile-picture">
          <div className="profile-picture-background"></div>
        </div>
      </div>
    </div>
  );
};

export default Profile;
